import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles/Orders.css';

const Orders = () => {
  const [orders, setOrders] = useState([]);
  const [filterStatus, setFilterStatus] = useState(['New', 'Packed', 'InTransit', 'Delivered']);
  const [count, setCount] = useState(0);

  useEffect(() => {
    getUsers();
  }, [filterStatus]);

  const getUsers = () => {
    axios
      .get('https://5fc1a1c9cb4d020016fe6b07.mockapi.io/api/v1/orders')
      .then((response) => {
        const filteredData = response.data.filter((item) =>
          filterStatus.includes(item.orderStatus)
        );
        setOrders(filteredData);
        setCount(filteredData.length);
      });
  };

  const handleFilterChange = (event) => {
    const value = event.target.value;
    setFilterStatus((prevStatus) =>
      event.target.checked ? [...prevStatus, value] : prevStatus.filter((status) => status !== value)
    );
  };

  const logOut = () => {
    window.localStorage.setItem('loginStatus', 'false');
    window.location.href = 'index.html';
  };

  return (
    <div>
      <div className="Topbar_Topbar">
        <div className="Topbar_LogoWrapper">
          <img src="../assets/logo.png" alt="logo" />
          <p className="Topbar_BrandName">Kafene</p>
        </div>
        <nav>
          <a href="orders.html" id="orders">Orders</a>
          <a href="product.html">Products</a>
          <a href="users.html">Users</a>
        </nav>
        <p id="logout" onClick={logOut}>Logout</p>
      </div>

      <div className="maincontainer">
        <h1>Orders</h1>
        <div className="Homepageorders">
          <div id="filters">
            <h3>Filters</h3>
            <p id="count">Count: {count}</p>
            <div>
              {['New', 'Packed', 'InTransit', 'Delivered'].map((status) => (
                <p key={status}>
                  <label className="checkbox">
                    <input
                      type="checkbox"
                      name="orders"
                      value={status}
                      checked={filterStatus.includes(status)}
                      onChange={handleFilterChange}
                    />
                    {status}
                  </label>
                </p>
              ))}
            </div>
          </div>

          <table className="Homepage_OrderTable">
            <thead>
              <tr>
                <th>ID</th>
                <th>Customer</th>
                <th>Date</th>
                <th>Amount</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody id="mytabledata">
              {orders.map((order) => (
                <tr key={order.id}>
                  <td>{order.id}</td>
                  <td>{order.customerName}</td>
                  <td>{order.orderDate}</td>
                  <td>{order.amount}</td>
                  <td>{order.orderStatus}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Orders;
